import Task from './Task'


const Tasks = ({ tasks, onDeleteTask }) =>
{

  return (
    <>
      {tasks.map((task) => (
        <Task task={task} deleteTask={onDeleteTask} />
       ))}     
    </>
  )
}

export default Tasks
